import React, { useEffect, useState } from "react";
import { getAllHippos } from "../controllers/getAllHippos";

const HippoCentral = () => {
  const [hippos, setHippos] = useState([]);
  useEffect(() => {
    getAllHippos()
      .then((res) => {
        setHippos(res);
        console.log("success", res);
      })
      .catch((err) => {
        console.log(err);
      });
  }, [hippos]);

  return <div>HIPPO!</div>;
};

export default HippoCentral;
